import React from 'react';
import PersonIcon from '@mui/icons-material/Person';
import IconButton from '@mui/material';

function Header() {
  return (
    <div className='header'>
        <IconButton>
            <PersonIcon fontSize='large' className='header_icon'/>
        </IconButton>
    </div>
  )
}

export default Header
